import App from '../../App';
import './VideoList.scss';

function VideoList() {
    return (
        <>
            <section className="VideoList">
                <h3 className="VideoList__title">NEXT VIDEO</h3>

                <div className="VideoList__container">
                    <img className="VideoList__image"/>
                    <p className="VideoList__title">Become A Travel Pro In One Easy Lesson...</p>
                    <p className="VideoList__author">Scotty Cranmer</p>
                </div>
            </section>
        </>
    )
}

export default VideoList;
